import axios from "axios";
import { useEffect } from "react";
import React from "react";
import { useParams } from "react-router-dom";
import { useDispatch, useSelector } from "react-redux";
import { moviedetailsreducers } from "./reducers/moviereducers";


const Test = ()=>{


    const {id} = useParams();
    const dispatch = useDispatch();
    // console.log(id)
    const post = useSelector((state)=>state.post);

    const fetchDetails = async() =>{
        const response = await axios.get(`https://www.omdbapi.com/?i=${id}&apikey=900505d8`).catch(err =>{
            console.log("Err", err);
        })

        dispatch(moviedetailsreducers(response.data));
    };
    useEffect(()=>{
        if(id && id !== "") fetchDetails();
    },[id]);
    return(
        <>
<h1>hi {id} hi</h1>
{/* <h2>{post.Title}</h2> */}


        </>
    );
}

export default Test;
